  return(
  <div className= {styles.nav} >
    <div className={styles.nav_wrapper}>
    <button  className={styles.nav_button }><a className = {styles.nav_link, ' current'} href='http://www.secure-booker.com/angelamichael/MakeAppointment/Search.aspx'>Book</a></button>
    <button className={styles.nav_button}>
      <a className={styles.nav_link} href='/'>Home</a></button>
    <button className={styles.nav_button}>
      <a className={styles.nav_link} href='/posts'>Blog</a>
      </button>
    </div>
  </div>
  )
};

export default Nav;
